    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE 24 + + - 52 NOT IN ( - col0 / + col0, + col2, - col2 / col2 * - + 11 / - col1, - 46, + ( + col0 ) / + 51 + + + 27 );
  - name: tab2

outputs:
  - name: q11940.out
    data: |
      46	51	23
      64	77	40
      75	67	58
